INSERT INTO `posts` (`id`, `status`, `title`, `slug`, `content`, `keywords`, `user_id`, `category_id`, `subcategory_id`, `img`, `hits`, `created_at`) VALUES
(1, 1, 'PHP blog script main features', 'php-blog-script-main-features', '<p>Simplest PHP based blog fully optimized for search engines 100% opensource code and ready to extend the features. logically inspired by wordpress, medium, gitbook &amp; ghost cms.<br>&nbsp;</p><h4><strong>Build with technologies : PHP MYSQL HTML CSS JS</strong></h4><h4><strong>Features</strong></h4><ul><li>100% opensource code</li><li>Categories module</li><li>Newsletter &amp; subscribers</li><li>SEO optimized</li><li>Google AMP Optimized via url/amp</li><li>Multi users accounts</li><li>Built-it pages views analytics</li><li>Post draft feature</li><li>Base64 article optimized images</li><li>Auto Sitemap generation</li><li>Beautify URLs</li><li>Social links and shares</li><li>Page hits views counter<br>&nbsp;</li></ul><h4><strong>Why PHP Blog Script</strong></h4><p>Starting your own niche based blog is very challenging specially when it comes to selecting any of your CMS or blog script. speed, performance, optimization, SEO and user-friendly are the options you need to be very handy. fancy cms and blog scripts are no more easy to handle configure or install on your shared or dedicated servers anymore. PHP Blog Script makes life much easier to just add your db credentials and install the entire platform within 2 minutes.</p><p>No plugins no libraries and fancy themes to customize and waste your time simple elegant and useful blog platform is ready for you to install for free and start blogging without wasting your time on search other blogging scripts.</p><p>Main <a href=\"http://phpblogscript.com/\">Website</a> Live <a href=\"http://phpblogscript.com/blog\">Demo</a></p>', 'php blog script, simple blogging, php blog script features, easy blog, free blog', 1, 1, NULL, '08-06-2021-1623179355.jpg', 0, '2021-05-28 03:40:29');
INSERT INTO `posts` (`id`, `status`, `title`, `slug`, `content`, `keywords`, `user_id`, `category_id`, `subcategory_id`, `img`, `hits`, `created_at`) VALUES
(2, 1, 'How to submit sitemap', 'how-to-submit-sitemap', '<p>Working with php blog script to submit your sitemap is super easy. no plugin no customization no additional tools required.</p><p>&nbsp;</p><p>login to your google search console panel and then add your property as suggested below :&nbsp;<br><br>Link &nbsp;<a href=\"https://search.google.com/search-console/\">https://search.google.com/search-console/</a></p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>point 1 click on search property&nbsp;<br>point 2 click on add property and verify your domain&nbsp;</p><p>&nbsp;</p><p>once your domain verified from google select your property from left navigation and then click on <strong>sitemaps </strong>as suggested on image blow&nbsp;</p><p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>point 1 click on sitemaps&nbsp;<br>point 2 add your sitemap link ( /<strong>blog/sitemap.xml</strong> )&nbsp;<br>point 3 view google status of crawl pages status below<br><br>once sitemap was submitted you will get this result from google&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>make sure all pages where submitted correctly and there are no errors mentioned by google.&nbsp;<br><br>once everything went well just keep checking on search console each 24 &nbsp;hours about google updates and pages crawl of data.&nbsp;</p><p>&nbsp;</p>', 'php blog script seo, how to submit sitemap, best way to rank website, easy sitemap', 1, 1, NULL, '08-06-2021-1623179682.jpg', 0, '2021-06-08 16:11:39');
INSERT INTO `posts` (`id`, `status`, `title`, `slug`, `content`, `keywords`, `user_id`, `category_id`, `subcategory_id`, `img`, `hits`, `created_at`) VALUES
(3, 1, 'Working with categories', 'working-with-categories', '<p>Working php blog script categories is very easy and simple. once your script is installed and you are ready to configure.&nbsp;</p><p>just login to your admin panel and from left side navigation click on categories as below.&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>after clicking on categories you will be landing to all categories page where you can add edit or remove categories as mentioned below.&nbsp;<br><br>to add new categories just click on add button mentioned on the right top corner.&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>then add your category name and credentials then hit to save button to save new category. as mentioned in below image.&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>it will take you back to all categories page where you can see newly added category.&nbsp;<br><br>to select your category on your post find the option in below image.&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>select your category on post and click on submit. this function works for both add new post or updating any previous added post.&nbsp;</p>', 'php blog script, categories section, how to add categories, how to edit categories', 1, 4, NULL, '08-06-2021-1623185379.jpg', 0, '2021-06-08 18:46:06');
INSERT INTO `posts` (`id`, `status`, `title`, `slug`, `content`, `keywords`, `user_id`, `category_id`, `subcategory_id`, `img`, `hits`, `created_at`) VALUES
(4, 1, 'PHP blog script released version v1.0', 'php-blog-script-released-version-v1.0', '<p>PHP Blog script is about to release its first beta version this year 2021. the initial testing has been already completed and the development is about to clean up with production-based bugs.&nbsp;<br><br>At the initial stage, we are looking for more people to download and testing our beta version. so we can get more testing details from UI UX to backend functionality.&nbsp;<br><br>We hope everyone will contribute to this amazing opportunity. as working with PHP blog script we enjoyed a lot.&nbsp;<br><br>Just give it a try its very simple fast secure and super SEO friendly.&nbsp;</p>', 'beta version, php blog script, initial release, php blog system, php blog based script', 1, 3, NULL, '28-05-2021-1622184016.jpg', 0, '2021-05-24 06:41:42');

